    const items = [
        {ava: "", name: "Archer", sell: "50", type: "Привелегия"},
        {ava: "", name: "Archer", sell: "50", type: "Привелегия"},
        {ava: "", name: "Archer", sell: "50", type: "Привелегия"},
        {ava: "", name: "Archer", sell: "50", type: "Привелегия"},
    ]
    return (
        <div>
            
            <Header type={true} />

            <div className="items">
                <Inputs />
                <ListCartItems items={items} />
                <BuyCalcer />
            </div>

        </div>
    )
};
